import React from 'react';
import './App.css';
import StartPage from './containers/StartPage'

function App() {
  return (
    <div className="App">
    <StartPage></StartPage>
      <header className="App-header">

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>

      </header>
    </div>
  );
}

export default App;
